DROP TABLE IF EXISTS `card_transfer`;
CREATE TABLE `card_transfer` (
  `card_id` int(11) NOT NULL,
  `card_ins_desc` varchar(64) NOT NULL,
  `card_ins_code` varchar(32) NOT NULL,
  `card_desc` varchar(64) DEFAULT NULL,
  `card_atm` int(11) DEFAULT NULL,
  `card_pos` int(11) DEFAULT NULL,
  `card_tracktwo` varchar(4) DEFAULT NULL,
  `card_trackthree` varchar(4) DEFAULT NULL,
  `card_tracktwo_length` int(11) DEFAULT NULL,
  `card_trackthree_length` int(11) DEFAULT NULL,
  `card_no_length` int(11) NOT NULL,
  `card_length` int(11) NOT NULL,
  `card_head` varchar(20) NOT NULL,
  `card_type_desc` varchar(64) DEFAULT NULL,
  `card_type` varchar(5) DEFAULT NULL,
  PRIMARY KEY (`card_id`),
  UNIQUE KEY `card_head` (`card_head`) USING BTREE,
  KEY `card_transfer_index` (`card_no_length`,`card_length`,`card_head`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

